import { Component } from 'react'
import 'isomorphic-fetch'

class CustomComponentBuilder extends Component {
    constructor (props) {
        super(props)
    }

    render () {
        <h1>Here is the content of the builder</h1>
    }
}

export default CustomComponentBuilder;
